import React from 'react';
import ReactDOM from 'react-dom';

export default props => (
    <Paper className={classes.root}>
        <Tabs
         value={value}
         onChange={handleChange}
         indicatorColor="primary"
         textColor="primary"
         centered
         >
          <Tab label="Item One" />
          <Tab label="Item Two" />
           <Tab label="Item Three" />
         </Tabs>
    </Paper>
);
